--
-- Описание для представления apartments_occupation
--
CREATE OR REPLACE 
	DEFINER = 'root'@'localhost'
VIEW apartments_occupation
AS
	select `a`.`id` AS `apartment_id`,count(`a`.`id`) AS `occupied`,`a`.`beds` AS `total_beds`,`a`.`number` AS `number`,`a`.`rooms` AS `rooms`,`a`.`space` AS `space`,`bt`.`type_name` AS `type_name`,`b`.`street` AS `street`,`b`.`number_in_street` AS `number_in_street`,`b`.`description` AS `description`,`b`.`id` AS `building_id`,`c`.`name` AS `city` from (((((`apartment` `a` join `building` `b` on((`a`.`building_id` = `b`.`id`))) join `building_types` `bt` on((`b`.`type` = `bt`.`id`))) join `city` `c` on((`b`.`city_id` = `c`.`id`))) join `role_on_apartment` `roa` on((`a`.`id` = `roa`.`apartment_id`))) join `person` `p` on((`roa`.`person_id` = `p`.`id`))) where ((`roa`.`ending` > now()) or isnull(`roa`.`ending`)) group by `a`.`id`,`a`.`beds`;

