AS
	select `p`.`id` AS `person_id`,`p`.`first_name` AS `first_name`,`p`.`family_name` AS `family_name`,`p`.`middle_name` AS `middle_name`,`p`.`sex` AS `sex`,`p`.`birth_date` AS `birth_date`,`p`.`entry` AS `entry`,`documents`.`document_id` AS `document_id`,`dp`.`person_is_owner` AS `person_is_owner`,`documents`.`document_type_id` AS `document_type_id`,`documents`.`document_name` AS `document_name`,`documents`.`field_id` AS `field_id`,`documents`.`field_name` AS `field_name`,`documents`.`description` AS `description` from ((`documents` join `document_person` `dp` on((`documents`.`document_id` = `dp`.`document_id`))) join `person` `p` on((`dp`.`person_id` = `p`.`id`))) where isnull(`documents`.`description`);

